import React from "react";
import TodoItem from "./Item/TodoItem";
import { BsCheck } from "react-icons/bs";

const todos = [
  {
    _id: "23",
    title: "finish yor homework",
    isCompleted: false,
  },
  {
    _id: "233",
    title: "wash dishes",
    isCompleted: false,
  },
  {
    _id: "243",
    title: "watch TV",
    isCompleted: false,
  },
];
const Home = () => {
  return (
    <div class="Home">
      <h1 className="">This is your TODO list</h1>
      {todos.map((todo) => (
        <div className="layout">
          <TodoItem key={todo._id} todo={todo} className="text-blue-900" />
        </div>
      ))}
    </div>
  );
};
export default Home;
